    containerSeries :{
        paddingTop:10,
        paddingBottom:16,
        paddingRight: 16,
        width: 140

    },

    tituloSeries :{
        color: '#fff',
        fontSize: 12,
        paddingTop: 8

   },

    notSeries:{
        fontSize: 10,
        color: '#fff',
        paddingLeft: 4
    },

    imagemSeries:{
        width: '100%',
        height: 170,
        borderRadius: 10
    }

    

})

export default style;
